operasi increment ( `++` ) itu ada nilai yang dikembalikan. Untujk pre-increment ( `++a` ) nilai yang dikembalikan adalah nilai setelah ditambah 1 sedangkan post-increment ( `a++` ) yang dikembalikan adalah nilai sebelum ditambah 1.

```int a = 3;
int b = ++a; // a = 4, b = 4

int c = 3;
int d = c++; // c = 4, d = 3```

Ketika pakai `cout` untuk operasi increment, nilai yang didisplay adalah nilai yang dikembalikan oleh operasi increment.
```int a = 3;
cout << ++a; // 4, nilai yang dikembalikan dari pre-increment. Nilai a sudah 4

int c = 3;
cout << c++; // 3, nilai yang dikembalikan dari post-increment. Nilai a sudah 4```

