Rules:
1. Dilarang menggunakan global variable.
2. Dilarang menggunakan static variable.
3. Dilarang menambah parameter pada function print_i.
4. Dilarang mengubah function main.
5. Hanya boleh menambahkan kode di dalam function print_i.
6. Tidak perlu menggunakan optimization.
7. Sebisa mungkin kode menggunakan arsitektur x86_64.


